            array("2160273", "15654808", "Pomme de terre*Trt Prod. Réc.*Limit. Destruct. Germes", "", "", "TRUE", "", "", "", "", "", "Dose maximale d'emploi  20 mLt  Non autorisé sur les pommes de terre destinées à la multiplication.  Délai après traitement  2 jours.  La dose totale de chlorprophame appliquée par lot de pommes de terre ne peut excéder 36 gt, toutes préparations confondues.  A titre indicatif, pour un stockage de 8 mois, les doses maximales de la préparation par application seraient   Pour des applications quotidiennes,   Premières applications 0,5 mLtonne de pommes de terre  Applications suivantes  0,25 mLtonne de pommes de terre  Pour des applications hebdomadaires   Premières applications 3 mLtonne de pommes de terre  Applications suivantes  1,5 mLtonne de pommes de terre  Pour des applications mensuelles   Première application 12,5 mLtonne de pommes de terre  Applications suivantes  6,25 à 10 mLtonne de pommes de terre  Pour des applications bimensuelles   Première application 20 mLtonne de pommes de terre  Applications suivantes  13,3 mLtonne de pommes de terre  ", "", "", ""),
