      array("9100505","11015924","Traitements généraux*Désherbage*Avt Mise Cult.","","","TRUE","","","","","","TRAITEMENTS GENERAUX * DESHERBAGE EN ZONES CULTIVEES * APRES RECOLTE Pour grandes cultures et cultures légumières Utiliser  à la dose de 3 Lha et respecter une ZNT de 5 m pour graminées annuelles.Utiliser à la dose de 6 Lha et respecter une ZNT de 5 m pour dicotylédones annuelles et bisannuelles.Utiliser à al dose de 7 Lha et respecter une ZNT de 20 m pour adventices vivaces.TRAITEMENTS GENERAUX * DESHERBAGE * HERBES VIVACES AVANT MISE EN CULTURE EN ZONES CULTIVEES Pour grandes cultures et cultures légumières Utiliser à la dose de 7 Lha et respecter une ZNT de 20 m pour adventices vivaces.Pour toutes espèces fruitières, vigne et zones non agricolesespaces verts Utiliser à la dose de 8 Lha et respecter une ZNT de 20 m pour adventices vivaces.Utiliser à la dose de 7 Lha et respecter une  ZNT de 20m pour  les usages Grandes cultures * désherbage * zones cultivées interculture * adventices vivaces, Cultures légumières * désherbage * avant mise en culture et en zones cultivées * adventices vivaces Utiliser à la dose de 8 Lha et respecter une  ZNT de 20m pour les usages Toutes espèces fruitières * Désherbage en zone cultivée avant mise en culture avant plantation * Adventices vivaces, Zones non agricoles Espaces Verts * Avant mise en culture * adventices vivaces et Vigne * désherbage en zone cultivée avant mise en culture avant plantation * adventices vivaces.TRAITEMENTS GENERAUX * DESHERBAGE * HERBES BIANNUELLES AVANT MISE EN CULTURE EN ZONES CULTIVEES Pour grandes cultures, cultures légumières, toutes espèces fruitières et vigne Utiliser  à la dose de 6 Lha et respecter une ZNT de 5 m pour dicotylédones annuelles et bisannuelles.Pour zones non agricolesespaces verts Utiliser  à la dose de 5 Lha et respecter une ZNT de 5 m pour annuelles et bisannuelles.","5.0","",""),
